    {
      "id": "bbb5b39c-8826-4f59-8c40-ff10529fa42f",
      "name": "Sticky Note1",
      "type": "n8n-nodes-base.stickyNote",
      "position": [
        -1520,
        -540
      ],
      "parameters": {
        "color": 7,
        "width": 601,
        "height": 1585,
        "content": "## 通过Webhook自动将Retell通话记录存储至Google Sheets/Airtable/Notion\n\n## 概述\n- 该工作流会在**[Retell](https://www.retellai.com/)**语音通话结束并完成分析后，将通话记录（包括文本转录、分析结果等）自动存储。\n- 监听Retell发送的`call_analyzed`类型webhook事件，并将数据存入**Airtable**、**Google Sheets**或**Notion**（根据您的技术栈选择）。\n- 适用于所有需要将已分析通话记录结构化存档的Retell智能体开发者。\n\n## 适用对象\n需要存储通话历史记录和关键分析数据的[Retell](https://www.retellai.com/)语音智能体开发者。\n\n## 先决条件\n- 拥有[Retell AI账户](https://www.retellai.com/)\n- [创建Retell智能体](https://docs.retellai.com/get-started/quick-start)\n- 为智能体绑定电话号码\n- 配置以下任意一个存储工具：\n  - 含数据表（如\"通话记录\"）的Airtable工作区\n  - 含\"通话记录\"工作表的Google表格\n  - 字段与转录数据匹配的Notion数据库\n- 模板参考：\n  - [Airtable模板](https://airtable.com/appN4jeIrD8waWCfr/shrsPtQLeqt8Sp3UZ)\n  - [Google表格模板](https://docs.google.com/spreadsheets/d/1TYgk8PK5w2l8Q5NtepdyLvgtuHXBHcODy-2hXOPP6AU/edit?usp=sharing)\n  - [Notion模板](https://www.notion.so/1cea19b9d4848089bda6f3d7e05a818d?v=1cea19b9d48481ea97ef000ccd20f210&pvs=4)\n\n## 工作原理\n- 当通话完成分析时，接收来自Retell的webhook POST请求\n- 过滤非`call_analyzed`类型事件（Retell会发送[三种webhook](https://docs.retellai.com/features/webhook-overview#webhook-overview)：`call_started`、`call_ended`和`call_analyzed`）\n- 提取关键字段包括：\n  - 通话ID、开始/结束时间、时长、总成本\n  - 文字记录、摘要、情感分析\n- 将数据存入指定工具：\n  - Airtable\n  - Google Sheets\n  - Notion\n\n## 使用指南\n1. 复制webhook地址（如`https://your-instance.app.n8n.cloud/webhook/poc-retell-analysis`），粘贴至Retell智能体的\"Webhook设置→智能体级Webhook URL\"\n2. 确保Airtable/Google表格/Notion数据库已配置正确字段\n3. 每次通话分析完成后，工作流将自动记录结果\n\n## 扩展功能\n- 若使用\"通话后分析\"字段，可在存储工具中新增对应列\n- 从`call.call_analysis.custom_analysis_data`对象提取自定义分析数据\n\n## 注意事项\n- 根据通话方向（呼入/呼出）提取对应电话号码字段（`from_number`或`to_number`）\n- 存储前将成本单位从美分转换为美元\n- 时间戳将转换为本地ISO格式字符串\n- 可移除不使用的输出模块（Airtable/Google Sheets/Notion）\n\n#### 👉 如需**分析Retell智能体通话数据**，欢迎联系[我们](mailto:hello@agentstudio.io)"
      },
      "typeVersion": 1
    },
